import { createRouter, createWebHistory } from 'vue-router'
import HomeView from '../views/HomeView.vue'
import Guests from '../views/GuestsView.vue'
import Tags from '../views/TagsView.vue'
import Users from '../views/UsersView.vue'
import Privileges from '../views/PrivilegesView.vue'
import Import from '../views/ImportView.vue'
import Export from '../views/ExportView.vue'
import GuestTag from '../views/GuestTagView.vue'

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/tags',
    name: 'tags',
    component : Tags,
    alias: '/guest_tag/tags',
  },
  {
    path: '/guests',
    name: 'guests',
    component : Guests
  },
  {
    path: '/guest_tag/:slug',
    name: 'guest_tag',
    component : GuestTag
  },
  {
    path: '/users',
    name: 'users',
    component : Users
  },
  {
    path: '/privileges',
    name: 'privileges',
    component : Privileges
  },
  {
    path: '/import',
    name: 'import',
    component : Import
  }
  ,
  {
    path: '/export',
    name: 'export',
    component : Export
  },
  //redirected /guest_tag/_name_ to _name_
  {
    // will always redirect /users/123/posts to /users/123/profile
    path: '/guest_tag/guests',
    redirect: to => {
      return 'guests'
    },
  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
